import React from 'react';
import HeroImage from '../assets/HeroImage.jpg';
import './Home.css';

const Home = () => (
    <div
        className="home"
        style={{
            backgroundImage: `url(${HeroImage})`,
        }}
    >
        <h1>GownCorner by GDL</h1>
        <p>Luxury Gown Rental</p>
        <button className="cta-button">Book A Gown</button>
    </div>
);

export default Home;
